import "Anasayfa.css";
function Anasayfa() {
  return (
    <div className="container">
      <div className="header">
        <h1>Teknolojik Yemekler</h1>
        <Link to="/siparisformu" className="aciktim-buton">Acıktım</Link>
      </div>
      <div className="content">
        <p>
          KOD ACIKTIRIR PİZZA DOYURUR
        </p>
      </div>
    </div>
  );
}

export default Anasayfa;
